<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>OBS REGEDIT</title>
<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.5.0/css/all.min.css">
  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
      font-family: 'Satoshi', sans-serif;
    }

    body {
      color: white;
      height: 100vh;
      overflow: hidden;
      position: relative;
    }

    #video-bg {
      position: fixed;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      object-fit: cover;
      z-index: -1;
    }

    .overlay {
      position: fixed;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      background-color: rgba(8, 8, 8, 0.7);
      z-index: -1;
    }

    .container {
      display: flex;
      justify-content: center;
      align-items: center;
      height: 100vh;
    }

    .profile-card {
      background-color: rgba(27, 27, 27, 0.5);
      backdrop-filter: blur(10px);
      border-radius: 20px;
      padding: 35px 15px;
      max-width: 40rem;
      width: 90%;
      text-align: center;
      border: 2px solid rgba(255, 255, 255, 0.05);
      box-shadow: 0 0 30px rgba(255, 255, 255, 0.1);
    }

    .profile-img {
      width: 120px;
      height: 120px;
      border-radius: 50%;
      object-fit: cover;
      border: 2px solid rgba(27, 27, 27, 0.4);
      margin-bottom: 20px;
    }

    .profile-name {
      font-size: 39.5px;
      font-weight: 600;
      margin-bottom: 10px;
      text-shadow: 0px 0px 16.5px #ffffff;
    }

    .profile-description {
      font-size: 19px;
      font-weight: 570;
      margin-bottom: 15px;
    }

    .location {
      display: flex;
      align-items: center;
      justify-content: center;
      gap: 5px;
      font-size: 15px;
      font-weight: 450;
      margin-bottom: 20px;
    }

    .discord-status {
      background: rgba(255, 255, 255, 0.07);
      border: 2px solid rgba(255, 255, 255, 0.05);
      border-radius: 12px;
      padding: 12px;
      margin: 25px auto;
      display: flex;
      align-items: center;
      justify-content: space-between;
      max-width: 300px;
    }

    .discord-avatar {
      width: 40px;
      height: 40px;
      border-radius: 50%;
      position: relative;
    }

    .discord-avatar img {
      width: 100%;
      height: 100%;
      border-radius: 50%;
    }

    .status-offline {
      position: absolute;
      bottom: -2px;
      right: -2px;
      width: 15px;
      height: 15px;
    }

    .discord-info {
      text-align: left;
      margin-left: 15px;
    }

    .discord-username {
      font-weight: 550;
      font-size: 18.5px;
      display: flex;
      align-items: center;
      gap: 5px;
    }

    .discord-badge {
      width: 20.5px;
      height: 20.5px;
    }

    .last-seen {
      font-weight: 300;
      font-size: 13.5px;
      color: rgba(255, 255, 255, 0.65);
    }

    .social-icons {
      display: flex;
      justify-content: center;
      gap: 30px;
      margin-top: 25px;
    }

    .social-icon {
      font-size: 26px;
      color: white;
      transition: 0.3s;
      filter: drop-shadow(#ffffff 1px 0 7px);
    }

    .social-icon:hover {
      color: #00ccff;
      transform: translateY(-3px);
    }

    .profile-views {
      font-size: 14px;
      font-weight: 550;
      margin-top: 20px;
      display: flex;
      align-items: center;
      justify-content: center;
      gap: 5px;
    }
  </style>
</head>
